  return (
    <div className="App">
      <div className="heading">
        <div className="logo">
          <a href="https://www.partselect.com"></a>
          <img src={logo} alt=""></img>
        </div>
      </div>
        <ChatWindow/>
    </div>
  );
}

export default App;
